import React, { Component } from 'react';
import './Board.css'; 
import Square from '../Square/Square';


class Board extends Component {
	constructor(){
		super();
	}


	renderSquare(){
	    return (
	      <Square />
	    );  
	}
	initSquares(){
		let squares = ''; 
		for(let i =0;i<63;i++){
			squares+='<Square />';
		}
		return squares; 
	}

	render(){
		return (
			<div id="board"> 
				{this.initSquares()}
			</div>
		);
	}
}
export default Board;
